import anyacat from './images/anyafon1.png'
import anyacatobr from './images/anyacatobr.png'
import './support-classes.css'
import anyazal from './images/anyazal.png'

export default function WhoUs() {
    flag = false

    function change_flag () {
        flag = !flag
    }

    function Note_create_and_delete (flag){
        const note = document.getElementById('appleBanner')
        if (flag) {
            note.style.opacity = 1
        } else {
            note.style.opacity = 0
        }
    }

    function NoteCreate(event) {
        const note = document.getElementById('appleBanner')
        note.style.opacity = 1

    }
    
     function NoteDelete(event){
        const note = document.getElementById('appleBanner')
        note.style.opacity = 0

        console.log('on')
    }

    return(
        <>
        
        <div className="opacity-0" id='appleBanner'>Аня я тебя люблю</div>
        <div className='relative lg:mx-96'>
        <img className='relative h-96' src={anyazal} alt='anyata'></img>
        <img className='absolute top-0 duration-75 lg:hover:scale-125 h-96 ' onMouseOver={NoteCreate} onMouseOut={NoteDelete} onClick={NoteCreate} src={anyacatobr} alt='anya'></img>
        </div>
        </>
    )}
